post_content = "<div class=\"col-sm-5\">
<div class=\"highlights\">
<h3>Why choose this route?</h3>
<ul>
 	<li>It's the perfect combination of wrecks and reefs.</li>
 	<li>The route stops at the best of the northern wrecks including SS Thislegorm and the site of Abu Nuhas.</li>
 	<li>Part of a National Park, the Brothers Islands are exclusive to liveaboards and more often than not you can spot sharks!</li>
 	<li>Route may include the protected area of Ras Mohamed.</li>
</ul>
</div>
</div>"
